import os from '../src/images/os.png';
import cn from '../src/images/CN.jpg';
import ai from '../src/images/AI.jpeg';
import coa from '../src/images/COA.jpg';
import cd from '../src/images/CD.png';
import web from '../src/images/WEBD.jpg';

const Sdata = [
    {
        image: web,
        title: "Web Development",
    },
    {
        image: os,
        title: "Operating Systems",
    },
    {
        image: cn,
        title: "Computer Networks",
    },
    {
        image: ai,
        title: "Artificial Intelligence",
    },
    {
        image: coa,
        title: "Computer Organization and Arch.",
    },
    {
        image: cd,
        title: "Compiler Design",
    },
];

export default Sdata;
